import React from 'react';
import { Box, Stack, Typography, Avatar, Card, Button } from '@mui/material'; // Assuming you're using Material UI
import CardContent from './CreateUser'
interface WelcomePageProps {
  // Add any props you might need for the page here, e.g., company logo, tagline
}

const Welcome = (): JSX.Element => {
  // Add any state or props you might need for the welcome page content

  return (
    <Box
      display="flex"
      justifyContent="center"
      alignItems="center"
      sx={{ height: '100vh', backgroundColor: '#f5f5f5' }} // Light background for contrast
    >
      <Card
        sx={{
          textAlign: 'center',
          width: '50%',
          padding: '20px',
          borderRadius: '10px',
          boxShadow: '0px 0px 10px 0px rgba(0,0,0,0.1)'
        }}
      >
        <CardContent>
          <Typography variant="h4" color="textPrimary" gutterBottom>
            Welcome to TechCorp!
          </Typography>
          {/* Add content for your welcome message here */}
          <Typography variant="body1">
            A platform for collaboration and innovation. Let's unlock your potential together.
          </Typography>
          {/* Add any buttons or links for further actions (e.g., sign up, explore) */}
          <Button variant="contained" size="large" color="primary">
            Get Started
          </Button>
        </CardContent>
      </Card>
    </Box>
  );
};

export default Welcome;
